import React from "react";

const Settings = () => {
  return (
    <section className="userBoard-right accounts-section">
      <h1 className="userBoard-right-header">Settings</h1>
      <div className="userBoard-right-subSec">
        <div className="userBoard-right-subHead">
          <div className="userBoard-header">Settings Information</div>
          <img src="" alt="" className="userBoard-icon" />
        </div>
        <div className="userBoard-right-subDetail">
          <div className="userBoard-right-single-group"></div>
        </div>
      </div>
    </section>
  );
};

export default Settings;
